        where (a.POSTINGSTAT =1) and 
        (a.CONTRACT like &#039;%%&#039; or a.CTDESC like &#039;%%&#039; or a.MANAGER like &#039;%%&#039; or a.SALESNAME like &#039;%%&#039;
        or a.PROJECT like &#039;%%&#039; or a.PRJDESC like &#039;%%&#039; or a.PONUMBERCUST like &#039;%%&#039; or a.CUSTOMER like &#039;%%&#039;
        or a.NAMECUST like &#039;%%&#039; or a.EMAIL1CUST like &#039;%%&#039; or a.CRMNO like &#039;%%&#039; or a.ORDERDESC like &#039;%%&#039;
        or a.SERVICETYPE like &#039;%%&#039; or a.CRMREMARKS like &#039;%%&#039; or a.ITEMNO like &#039;%%&#039; or a.MATERIALNO like &#039;%%&#039;
        or a.STOCKUNIT like &#039;%%&#039;) and
        (a.PODATECUST&gt;=20220101 and a.PODATECUST&lt;=20230630)
